oxy_webhelp_navlinks = {"wid_using_widgets_c-d4802e8578":{"topics":[{"title":"How do I create a Notes widget from a form or document?","shortdesc":"<p class=\"shortdesc\">You can create a widget that opens an HCL Notes® document or that fills out a Notes form using a default value, selected Live Text, or typed values. <\/p>","href":"wid_create_widget_notes_t.html","attributes":{"data-id":"wid_create_widget_notes_t"},"menu":{"hasChildren":false},"tocID":"wid_create_widget_notes_t-d4802e8609","topics":[]},{"title":"How do I create an XPages widget?","shortdesc":"<p class=\"shortdesc\">You can create a widget to search HCL Notes® XPages using a default value, selected Live Text, or other selected text. You can also use this wizard to open the target XPage.<\/p>","href":"wid_create_widget_xpages_t.html","attributes":{"data-id":"wid_create_widget_xpages_t"},"menu":{"hasChildren":false},"tocID":"wid_create_widget_xpages_t-d4802e8637","topics":[]},{"title":"How do I create a Notes widget from a view or frameset?","shortdesc":"<p class=\"shortdesc\">You can create a widget to search an HCL Notes® view using a default value, selected Live Text, or other selected text. You can also use this wizard to open the target Notes view or frameset.<\/p>","href":"wid_create_widget_notes_view_t.html","attributes":{"data-id":"wid_create_widget_notes_view_t"},"menu":{"hasChildren":false},"tocID":"wid_create_widget_notes_view_t-d4802e8665","topics":[]},{"title":"How do I create a Web page widget?","shortdesc":"<p class=\"shortdesc\">You can create a widget that acts on a default value, selected Live Text, or other selected text using a single form on a specific Web page. Or you can create a widget that can perform one or more actions based on an overall Web page. You can optionally require that the user authenticate before using the Web page action. <\/p>","href":"wid_create_widget_web_t.html","attributes":{"data-id":"wid_create_widget_web_t"},"menu":{"hasChildren":false},"tocID":"wid_create_widget_web_t-d4802e8694","topics":[]},{"title":"How do I create a Google Gadget widget?","shortdesc":"<p class=\"shortdesc\">You can create a Google Gadget™ widget to extend your application and simplify certain tasks. <\/p>","href":"wid_create_widget_google_t.html","attributes":{"data-id":"wid_create_widget_google_t"},"menu":{"hasChildren":true},"tocID":"wid_create_widget_google_t-d4802e8719","next":"wid_create_widget_google_t-d4802e8719"},{"title":"How do I create a Feeds widget?","shortdesc":"<p class=\"shortdesc\">You can create a widget to stay connected to your favorite feeds subscriptions using a widget. You can configure the feeds-based widget to be linked to a default value, selected Live Text, or other selected text. <\/p>","href":"wid_create_widget_feeds_t.html","attributes":{"data-id":"wid_create_widget_feeds_t"},"menu":{"hasChildren":false},"tocID":"wid_create_widget_feeds_t-d4802e8775","topics":[]},{"title":"How do I create a Features and Plugins deployment widget?","shortdesc":"<p class=\"shortdesc\">You can create a widget for deploying features and plug-ins to client users. <\/p>","href":"wid_create_widget_feat_plugin_t.html","attributes":{"data-id":"wid_create_widget_feat_plugin_t"},"menu":{"hasChildren":false},"tocID":"wid_create_widget_feat_plugin_t-d4802e8800","topics":[]},{"title":"How do I create a Composite Applications widget?","shortdesc":"<p class=\"shortdesc\">You can create a widget using the active composite application as the current context.<\/p>","href":"wid_create_widget_compapp_t.html","attributes":{"data-id":"wid_create_widget_compapp_t"},"menu":{"hasChildren":false},"tocID":"wid_create_widget_compapp_t-d4802e8826","topics":[]}]}};